import React from "react";

function HeaderInput({setProduct}){
        function handleChange(e){
              setProduct(e.target.value)
        }
    return(
        <div className="flex rounded-3xl bg-white w-[40%] items-center">
                <img className="p-2 pr-0" src="./search.png" alt="" />
                <input onChange={handleChange}  className="pl-2 text-lg outline-none bg-transparent w-full" ></input>
        </div>
)}

export default HeaderInput
